■バイク積載方法はトップチューブ2ヶ所＋シートチューブ1ヶ所の3点固定。揺れを極限まで低減。<br>■本体に付属の6本の強靭なベルトとフックで、確実に固定。<br>　 （フック形状が車両に合わない場合は別売のオプションパーツを使用して固定）<br>■強靭なガスインジェクション成形アームを採用。脱着簡単。使わない時はコンパクトに収納。<br><br><font size="2" color="#ff0000"><b>〈ご注意〉<br>※キャリア装着時には、トランク、リアハッチの開閉はしないで下さい。リアワイパーは使用できない場合があります。<br>※バイクのフレーム形状によっては、装着できない場合があります。また前輪を外して装着する事をお薦めします。<br>※道路交通法を守って安全に走行しましょう。<br><br><br><br></font><style type="text/css">
